description:
When we got the suggestion to profile Princess Superstar, who is apparently some kind of "humorous rapper/DJ" who had worked with the likes of Moby, Grandmaster Flash, and Lana Del Ray, we had two questions:

1. Is she Jewish?

2. How did she get that name?

The answers are simple:

1. Yes, her real last name is Kirschner.

2. She used a random name generator. Try it below!



