females = new Array("Princess", "Empress", "Queen", "Duchess", "Countess", "Lady", "Baroness", "Mistress", "Dame", "Diva", "Madam");

males = new Array("Prince", "Emperor", "King", "Duke", "Count", "Lord", "Baron", "Master", "Sir", "Knight", "Squire", "Earl", "Commander", "Captain", "General", "Major");

suffixes = new Array("Superstar", "Supernova", "Awesomeness", "Greatness", "Intensity", "Strength", "Power", "Courage", "Vigor", "Tenacity", "Vitality", "Beauty", "Majesty", "Grace", "Charm", "Elegance", "Allure", "Glamor", "Charisma", "Enticement", "Sunshine", "Moonlight", "Lightning", "Thunder", "Storm", "Illumination", "Blaze", "Glory", "Sunlight", "Flash", "Glow", "Beacon", "Brightness", "Brilliance", "Incandescence", "Luster", "Radiance", "Shine", "Sparkle", "Essence", "Comet", "Meteor", "Constellation", "Eruption", "Tsunami", "Hurricane", "Typhoon", "Cyclone", "Monsoon", "Destiny", "Champion", "Superhero", "Conqueror", "Warrior");

fn = 'Princess'; ln = 'Superstar';
function generate() {
lastFn = fn; lastLn = ln;
male = document.rf.sex[0].checked;
while (fn == lastFn) {
 fn = male ? randomElement(males) : randomElement(females);
}
while (ln == lastLn) {
 ln = randomElement(suffixes);
}
document.rf.two.value = fn + ' ' + ln;
}
